import React from "react";
import { NavLink, useNavigate } from "react-router-dom";
import "./Navbar.css";
import GymIcon from "./../assets/icons/gym.png";

const Navbar = () => {
  const navigate = useNavigate();
  const isLoggedIn = !!localStorage.getItem("email");

  const handleLogout = () => {
    localStorage.removeItem("email");
    navigate("/logout");
  };

  return (
    <nav className="white-navbar">
      <div className="white-navbar-container">
        <div className="white-navbar-logo">
          <span role="img" aria-label="logo">
            <img src={GymIcon} alt="Jump" className="level-icon-img" />
          </span>
          FitTracker
        </div>
        <div className="white-navbar-links">
          <NavLink to="/" className="white-nav-link">
            Home
          </NavLink>
          {isLoggedIn ? (
            <>
              <NavLink to="/profile" className="white-nav-link">
                Profile
              </NavLink>
              <NavLink to="/daily-challenge" className="white-nav-link">
                Daily
              </NavLink>
              <NavLink to="/adventure-map" className="white-nav-link">
                Map
              </NavLink>
              <NavLink to="/chatbot" className="white-nav-link">
                Chatbot
              </NavLink>
            </>
          ) : null}
          <NavLink to="/leaderboard" className="white-nav-link">
            Rank
          </NavLink>
          {!isLoggedIn ? (
            <NavLink to="/login" className="white-nav-link">
              Login
            </NavLink>
          ) : (
            <span className="white-nav-link logout-link" onClick={handleLogout}>
              Logout
            </span>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
